import React, { useEffect, useState } from 'react';
import { ComposedChart, Bar, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer, Line } from 'recharts';

const generateRandomData = () => {
    const data = [];
    for (let i = 0; i < 10; i++) {
        const open = Math.random() * 100;
        const close = Math.random() * 100;
        const high = Math.max(open, close) + Math.random() * 10;
        const low = Math.min(open, close) - Math.random() * 10;
        data.push({
            name: `Point ${i + 1}`,
            open,
            close,
            high,
            low,
        });
    }
    return data;
};

const Page4 = () => {
    const [data, setData] = useState(generateRandomData());

    useEffect(() => {
        const interval = setInterval(() => {
            setData(generateRandomData());
        }, 10000); // обновление каждые 10 секунд

        return () => clearInterval(interval); // очистка интервала при размонтировании компонента
    }, []);

    return (
        <div style={{ width: '100%', height: '400px' }}>
            <ResponsiveContainer>
                <ComposedChart data={data}>
                    <CartesianGrid stroke="#f5f5f5" />
                    <XAxis dataKey="name" />
                    <YAxis />
                    <Tooltip />
                    <Bar dataKey="low" fill="#8884d8" />
                    <Bar dataKey="high" fill="#82ca9d" />
                    <Line type="monotone" dataKey="open" stroke="#ff7300" />
                    <Line type="monotone" dataKey="close" stroke="#387908" />
                </ComposedChart>
            </ResponsiveContainer>
        </div>
    );
};

export default Page4;
